import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import Login from "../pages/Login";
import Signup from "../pages/Signup";

const AppRoutes = (props) => {

  return (
    <React.Fragment>
      <Switch>
        <Route  path="/signup">
          <Signup />
        </Route>
        <Route  path="/login">
          <Login />
        </Route>
        <Route path="/">
          <Login />
        </Route>

        <Route path="/">
          <Login />
        </Route>


      </Switch>
    </React.Fragment>
  );
};
export default AppRoutes;
